import React from 'react';
import TeamData from '../../static/team-page-info'; 
import Avatar from '@material-ui/core/Avatar'; 
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import './TeamPage.css';


const styles = { 
  avatar: {
    margin: "auto",
    width: "150px",
    height: "150px",
  }
}

export default function TeamPage(props) {
  const { classes } = props;
  return (
    <div>
      <h1>Our Team</h1>
      <Grid container spacing={0} 
      alignItems="center"
      justify="center">          
        {TeamData.teamData.map((member) => (
          <Grid item xs={12} sm={4}>
            <Avatar src={member.image} className={classes.avatar}></Avatar>
            <p style={{marginLeft: "10%", textAlign: "left"}}>
            <span style={{fontWeight: "bold"}}>{member.name}</span>
            <br></br><br></br>
            {member.bio}</p>
          </Grid>
        ))}
      </Grid>
    </div>

  );
}
